import { Add } from '@mui/icons-material';
import {
  Button,
  List,
  ListSubheader,
  ListItemButton,
  ListItemIcon,
  ListItemText,
  ListItem,
  IconButton,
  Typography,
  TextField,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import { useEffect, useRef, useState } from 'react';
import { fetchData } from '../utils';

const Courses = () => {
  const [data, setData] = useState([]);
  const newCourseRef = useRef();

  useEffect(() => {
    fetchData('author/courses/', setData);
  }, []);

  return (
    <>
      <Button onClick={() => console.log(data)} variant='contained' startIcon={<Add />}>
        Add Course
      </Button>
      <TextField ref={newCourseRef} variant='standard' />
      <List
        sx={{ width: '100%', bgcolor: 'background.paper' }}
        component='nav'
        aria-labelledby='nested-list-subheader'
        subheader={
          <ListSubheader component='div' id='nested-list-subheader'>
            Nested List Items
          </ListSubheader>
        }
      >
        {Object.values(data).map((course) => (
          <ListItem
            key={course.id}
            disablePadding
            secondaryAction={
              <IconButton edge='end' aria-label='delete' sx={{ background: 'white' }}>
                <DeleteIcon />
              </IconButton>
            }
          >
            <ListItemButton variant='text' color='inherit'>
              <ListItemText
                primary={course.title}
                sx={{ textOverflow: 'ellipsis', whiteSpace: 'nowrap', overflow: 'hidden' }}
              />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
    </>
  );
};

export default Courses;
